import React, { Component } from 'react'

class Foot extends Component {
    render() {
        const Foot = {
            position: 'relative',
            backgroundColor: '#30a64f',
            //border: '3px solid blue',
            minHeight: '150px',
            backgroundImage: 'linear-gradient(#30a64f 10%, 90%, #000000 100%)'
        };

        return (
            <div style = { Foot }>
                ettet
            </div>
        )
    }
}

export default Foot;
